import React, { useState } from 'react'
// import Lilisting from './Lilisting'

const Listing = (props) => {
    const [value, setValue] = useState(props.data || [])
    return(
        <ul>
            {value?.map((res)=>(
                {id, name, age, location, number} = res
                (

                    <li key={res.id}>{res.name}</li>
                    // <li key={res.id}><Lilisting val={res} /></li>
                )
            ))}
        </ul>
    )
}

export default Listing
